export const setIdPhoto = idPhoto => ({
  type: 'SET_ID_PHOTO',
  payload: idPhoto
});
export const setPhoto = photo => ({
  type: 'SET_PHOTO',
  payload: photo
});
export const setShowed = showed => ({
  type: 'SET_SHOWED',
  payload: showed
});
export const removeShowed = remove => ({
  type: 'REMOVE_SHOWED',
  payload: remove
});